import React from 'react';

const SearchBox = ({ searchTerm, setSearchTerm }) => (
  <input 
    type="text" 
    placeholder="Search drivers..." 
    value={searchTerm}
    onChange={e => setSearchTerm(e.target.value)}
  />
);

export default SearchBox;
